styles.value:
.d-ui-widget, .ui-widget, .d-node-content > * { color: #ffffff; }
.d-ui-widget, .ui-widget { background-image: none; background-color: #ff6929; border-radius: 0px; -webkit-border-radius: 0px; -moz-border-radius: 0px; }
.d-ui-widget, .ui-widget, .d-separator, .d-tooltip:before, .d-tooltip:after, .d-grid th, .d-grid td, .d-item-spliter { border-color: #eb4249; }

.d-ui-widget-content, .ui-widget-content, .d-ui-widget-header.d-tabs-nav.d-state-active > a, .d-checkbox, .d-radio, .d-rating, a.d-button.link { color: #000000; }
.d-ui-widget.d-tooltip, .d-state-info, .d-item-counter { color: #5d2e0e; background-color: #f3d8d3; border-color: #d94317; }
.d-overlay { background-color: #fbebe4; background-image: none; }
.d-ui-widget-content, .ui-widget-content, .d-tabs-nav.d-state-active { background-color: #ffffff; background-image: none; }
.d-radio,.d-checkbox,.d-rating,a.d-button.link,.ui-state-default>a,.ui-state-default {color:#81240e;}
